(()=>{window.Webflow||(window.Webflow=[]);window.Webflow.push(()=>{let t=document.querySelector("[brs-multirefsort-element='list']");if(!t)return;let r=Array.from(t.querySelectorAll(".w-dyn-item"));r.forEach(e=>e.parentElement.removeChild(e)),r.sort((e,l)=>{let o=e.querySelector("[brs-multirefsort-element='sortvalue']").textContent,n=l.querySelector("[brs-multirefsort-element='sortvalue']").textContent;return o>n?1:o<n?-1:0}),r.forEach(e=>t.append(e))});})();
